import Nav from "./Nav";
import CreateAccount from "./CreateAccount";
import Login from "./Login";
import Members from "./Members";
import Blogs from "./Blogs";

const NavBar = ()=>{
    return(
        <>
            <Nav>
                <Members></Members>
                <Blogs></Blogs>
                <Login></Login>
                <CreateAccount></CreateAccount>
            </Nav>
        </>
    )
}

export default NavBar;
